    return (
        <div id="control-button">
            <div className="button-control-section" id="button-section-editor" onClick={openLabelEditorSection}>Редактор Шаблонов</div>
            <div className="button-control-section" id="button-section-user-editor" onClick={openUserSection}>Редактор Пользователей</div>
            <div className="button-control-section" id="button-section-logo-editor" onClick={openLogoEditorSection}>Редактор Данных</div>
            {/* <div className="button-control-section" id="button-section-editor" onClick={openLabelEditorSection}>Редактор Шаблонов</div>
